import Card from './Card'; // Ajusta la ruta de importación según tu estructura de archivos

export default function DogsList({ dogs }) { // Asumiendo que recibes una lista de perros llamada "dogs"
    return (
        <div>
            {dogs.map((dog) => (
                <Card key={dog.id} dog={dog} />
            ))}
        </div>
    );
}
